import React, { useState, useEffect } from 'react';
import { 
  Clock, 
  ArrowRight, 
  Activity, 
  Zap, 
  Coffee, 
  Utensils, 
  ChevronDown,
  ChevronUp
} from 'lucide-react';

// This would use your actual biorhythm engine imports
import { biorhythmEngine, getSassyRecommendation } from './BiorhythmEngine';

const BiorhythmPreview = ({ colors, setActiveScreen }) => {
  // State management
  const [bioData, setBioData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [isExpanded, setIsExpanded] = useState(false);

  // Get current time
  const now = new Date();
  const currentHour = now.getHours();

  // Mock biorhythm engine for demonstration - replace with real engine integration
  const mockBiorhythmEngine = {
    getRecommendations: () => ({
      currentScore: {
        overall: 78,
        physical: 65,
        emotional: 82,
        intellectual: 72,
        metabolic: 85
      },
      dominantRhythm: {
        type: 'metabolic',
        value: 85
      },
      nextTransition: {
        from: 'metabolic',
        to: 'emotional',
        hoursFromNow: 3
      },
      hourlyData: Array(24).fill().map((_, i) => ({
        hour: i,
        overall: 0.5 + 0.3 * Math.sin(i / 3)
      })),
      recommendations: {
        medicationTiming: [8, 9, 19, 20],
        exerciseTiming: [11, 12, 13, 17, 18],
        mealTiming: [7, 8, 12, 13, 18, 19],
        focusTiming: [9, 10, 11, 14, 15, 16],
        sleepTiming: [22, 23, 0, 1, 2, 3, 4, 5]
      }
    })
  };

  // Load biorhythm data
  useEffect(() => {
    const timer = setTimeout(() => {
      try {
        // Replace with actual engine when integrating
        const data = mockBiorhythmEngine.getRecommendations();
        setBioData(data);
      } catch (error) {
        console.error("Failed to load biorhythm data:", error);
      } finally {
        setIsLoading(false);
      }
    }, 800);

    return () => clearTimeout(timer);
  }, []);

  // Get current rhythm state
  const getCurrentRhythmState = () => {
    if (!bioData) return {
      type: 'metabolic',
      name: 'Metabolic',
      icon: <Utensils size={20} />,
      color: colors.warning,
      value: 85,
      description: "Your metabolism is peaking. Perfect time for that meal you've been craving.",
      sassyTip: "Metabolism in overdrive. Finally, a scientific excuse to eat that donut."
    };

    const type = bioData.dominantRhythm.type;
    const value = bioData.currentScore[type];

    const stateMap = {
      physical: {
        name: 'Physical',
        icon: <Activity size={20} />,
        color: colors.success,
        description: "Your body is at peak performance right now.",
        sassyTip: "Your physical energy is peaking. Get moving before your body realizes what's happening."
      },
      emotional: {
        name: 'Emotional',
        icon: <Zap size={20} />,
        color: colors.accentAlt,
        description: "Your emotional intelligence is at its highest.",
        sassyTip: "Emotional intelligence at max capacity. Perfect for deep talks or dramatic social media posts."
      },
      intellectual: {
        name: 'Mental',
        icon: <Coffee size={20} />,
        color: colors.primary,
        description: "Your cognitive functions are optimized.",
        sassyTip: "Brain firing on all cylinders. Quick, solve that problem before it wears off."
      },
      metabolic: {
        name: 'Metabolic',
        icon: <Utensils size={20} />,
        color: colors.warning,
        description: "Your metabolism is peaking right now.",
        sassyTip: "Metabolism in overdrive. Finally, a scientific excuse to eat that donut."
      }
    };

    return {
      type,
      value,
      ...stateMap[type]
    };
  };

  // Get next optimal times for activities
  const getNextOptimalTime = (activityType) => {
    if (!bioData) return "3:00 PM";

    const formatHour = (hour) => {
      return hour === 0 ? "12 AM" : 
             hour === 12 ? "12 PM" : 
             hour < 12 ? `${hour} AM` : `${hour-12} PM`;
    };

    const hours = bioData.recommendations[activityType + 'Timing'] || [];
    const futureHours = hours.filter(h => h > currentHour);

    if (futureHours.length === 0) {
      return "Tomorrow";
    }

    return formatHour(futureHours[0]);
  };

  // Calculate biorhythm wave points for the chart
  const getBiorhythmPoints = () => {
    if (!bioData) {
      // Fallback wave pattern
      return Array(24).fill().map((_, i) => 0.5 + 0.3 * Math.sin(i / 3));
    }

    return bioData.hourlyData.map(data => data.overall);
  };

  const currentState = getCurrentRhythmState();
  const wavePoints = getBiorhythmPoints();

  return (
    <div 
      className="mb-8 rounded-2xl bg-white overflow-hidden transition-shadow duration-300 hover:shadow-xl"
      style={{ boxShadow: '0 10px 25px -5px rgba(59, 130, 246, 0.2)' }}
    >
      {/* Top section with header and timer */}
      <div className="px-6 pt-5 pb-3 border-b border-blue-50">
        <div className="flex justify-between items-center mb-1">
          <h3 className="font-bold text-lg tracking-tight" style={{ color: colors.textPrimary }}>
            Biorhythm Now
          </h3>
          <div className="flex items-center">
            <button 
              onClick={() => setIsExpanded(!isExpanded)}
              className="text-xs font-medium mr-3 text-blue-400 hover:text-blue-600 transition-colors flex items-center"
            >
              {isExpanded ? (
                <>Less <ChevronUp size={14} className="ml-1" /></>
              ) : (
                <>More <ChevronDown size={14} className="ml-1" /></>
              )}
            </button>
            <button 
              onClick={() => setActiveScreen('biorhythm')}
              className="text-sm font-medium rounded-full px-3 py-1 transition-all duration-300 flex items-center group hover:shadow"
              style={{ 
                background: 'linear-gradient(to right, rgba(37, 99, 235, 0.1), rgba(6, 182, 212, 0.1))',
                color: colors.primary
              }}
            >
              Details
              <ArrowRight size={14} className="ml-1 transform transition-transform duration-300 group-hover:translate-x-0.5" />
            </button>
          </div>
        </div>
        <div className="flex items-center text-xs text-gray-400">
          <Clock size={12} className="mr-1.5" />
          <span>
            {now.toLocaleTimeString([], {hour: '2-digit', minute:'2-digit'})}
          </span>
        </div>
      </div>

      {/* Main content area */}
      <div className="p-5">
        {isLoading ? (
          /* Elegant loading state */
          <div className="py-4 space-y-6">
            <div className="animate-pulse h-10 bg-blue-50 rounded-xl w-full"></div>
            <div className="animate-pulse h-24 bg-gradient-to-r from-blue-50 to-blue-100 rounded-xl w-full"></div>
            <div className="animate-pulse h-4 bg-blue-50 rounded-full w-3/4"></div>
          </div>
        ) : (
          <>
            {/* Biorhythm visualization */}
            <div className="relative h-12 mb-6 pt-3">
              {wavePoints.map((point, i) => {
                const isCurrent = i === currentHour;
                const height = `${Math.max(15, point * 100)}%`;

                return (
                  <div 
                    key={i} 
                    className="absolute bottom-0 w-[3.5px] transition-all duration-500"
                    style={{ 
                      height, 
                      left: `${(i / 24) * 100}%`,
                      backgroundColor: isCurrent ? currentState.color : 'rgba(37, 99, 235, 0.3)',
                      opacity: isCurrent ? 1 : 0.3 + point * 0.7, 
                      transform: isCurrent ? 'scaleY(1.05)' : 'scaleY(1)',
                      borderRadius: '2px 2px 0 0'
                    }}
                  >
                    {isCurrent && (
                      <div className="absolute -top-7 left-1/2 transform -translate-x-1/2 whitespace-nowrap">
                        <div className="px-2 py-0.5 rounded-full text-xs bg-blue-600 text-white font-medium shadow-sm">
                          Now
                        </div>
                      </div>
                    )}
                  </div>
                );
              })}

              {/* Time indicators */}
              <div className="absolute bottom-[-10px] left-0 text-[8px] text-blue-400">12a</div>
              <div className="absolute bottom-[-10px] left-1/4 transform -translate-x-1/2 text-[8px] text-blue-400">6a</div>
              <div className="absolute bottom-[-10px] left-1/2 transform -translate-x-1/2 text-[8px] text-blue-400">12p</div>
              <div className="absolute bottom-[-10px] left-3/4 transform -translate-x-1/2 text-[8px] text-blue-400">6p</div>
              <div className="absolute bottom-[-10px] right-0 transform translate-x-0 text-[8px] text-blue-400">12a</div>
            </div>

            {/* Current state card */}
            <div 
              className="p-5 mb-4 rounded-xl relative overflow-hidden transition-all duration-500"
              style={{
                background: `linear-gradient(135deg, ${currentState.color}15, ${currentState.color}05)`,
                borderLeft: `3px solid ${currentState.color}`
              }}
            >
              <div className="flex items-center">
                <div 
                  className="w-12 h-12 rounded-full flex items-center justify-center mr-4"
                  style={{ 
                    background: `linear-gradient(135deg, ${currentState.color}, ${currentState.color}90)`,
                    boxShadow: `0 3px 10px ${currentState.color}40`
                  }}
                >
                  {React.cloneElement(currentState.icon, { color: "white" })}
                </div>

                <div className="flex-1">
                  <div className="flex items-center mb-1">
                    <h4 className="text-lg font-bold mr-2" style={{ color: currentState.color }}>
                      {currentState.name} Peak
                    </h4>
                    <div 
                      className="text-xs font-bold py-0.5 px-2 rounded-full"
                      style={{ backgroundColor: `${currentState.color}20`, color: currentState.color }}
                    >
                      {currentState.value}%
                    </div>
                  </div>

                  <p className="text-sm" style={{ color: colors.textSecondary }}>
                    {currentState.sassyTip}
                  </p>

                  {bioData?.nextTransition && (
                    <div className="mt-2 text-xs" style={{ color: colors.textSecondary }}>
                      Next shift: <span className="font-medium">{bioData.nextTransition.hoursFromNow}h</span> to <span className="font-medium">{bioData.nextTransition.to}</span> peak
                    </div>
                  )}
                </div>
              </div>
            </div>

            {/* Activity recommendations */}
            {isExpanded && (
              <div className="grid grid-cols-3 gap-3 pt-2 animate-fade-in overflow-hidden">
                {[
                  {
                    name: "Exercise",
                    next: getNextOptimalTime("exercise"),
                    icon: <Activity size={16} />,
                    color: colors.success,
                    tip: "Ideal workout time"
                  },
                  {
                    name: "Focus",
                    next: getNextOptimalTime("focus"),
                    icon: <Coffee size={16} />,
                    color: colors.primary,
                    tip: "Peak concentration"
                  },
                  {
                    name: "Eat",
                    next: getNextOptimalTime("meal"),
                    icon: <Utensils size={16} />,
                    color: colors.warning,
                    tip: "Optimal metabolism"
                  }
                ].map((activity, idx) => (
                  <div 
                    key={idx} 
                    className="p-3 rounded-lg transition-all duration-300 hover:shadow-sm"
                    style={{ backgroundColor: `${activity.color}08`, border: `1px solid ${activity.color}20` }}
                  >
                    <div className="flex items-center mb-1">
                      <div 
                        className="w-7 h-7 rounded-full flex items-center justify-center mr-2"
                        style={{ backgroundColor: `${activity.color}20`, color: activity.color }}
                      >
                        {activity.icon}
                      </div>
                      <div className="flex-1">
                        <div className="text-xs font-medium" style={{ color: colors.textPrimary }}>
                          {activity.name}
                        </div>
                        <div className="text-xs" style={{ color: colors.textSecondary }}>
                          {activity.tip}
                        </div>
                      </div>
                    </div>
                    <div className="flex justify-between items-center text-xs font-bold mt-1" style={{ color: activity.color }}>
                      Next: {activity.next}
                    </div>
                  </div>
                ))}

                {/* Current biorhythm values */}
                <div className="col-span-3 mt-1">
                  <div className="flex items-center justify-between p-4 rounded-lg bg-blue-50">
                    {[
                      { name: 'Physical', value: bioData?.currentScore.physical || 65, color: colors.success, icon: <Activity size={14} /> },
                      { name: 'Emotional', value: bioData?.currentScore.emotional || 82, color: colors.accentAlt, icon: <Zap size={14} /> },
                      { name: 'Mental', value: bioData?.currentScore.intellectual || 72, color: colors.primary, icon: <Coffee size={14} /> },
                      { name: 'Metabolic', value: bioData?.currentScore.metabolic || 85, color: colors.warning, icon: <Utensils size={14} /> }
                    ].map((rhythm, idx) => (
                      <div key={idx} className="flex flex-col items-center">
                        <div className="relative mb-1">
                          <svg width="32" height="32" viewBox="0 0 32 32">
                            <circle 
                              cx="16" 
                              cy="16" 
                              r="14" 
                              fill="none" 
                              stroke="#e5e7eb" 
                              strokeWidth="2.5"
                            />
                            <circle 
                              cx="16" 
                              cy="16" 
                              r="14"
                              fill="none"
                              stroke={rhythm.color}
                              strokeWidth="2.5"
                              strokeDasharray={`${rhythm.value * 0.88} 100`}
                              strokeLinecap="round"
                              transform="rotate(-90 16 16)"
                            />
                          </svg>
                          <div 
                            className="absolute inset-0 flex items-center justify-center"
                            style={{ color: rhythm.color }}
                          >
                            {rhythm.icon}
                          </div>
                        </div>
                        <span className="text-xs" style={{ color: colors.textSecondary }}>{rhythm.name}</span>
                        <span className="text-xs font-bold" style={{ color: rhythm.color }}>{rhythm.value}%</span>
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            )}
          </>
        )}
      </div>

      <style jsx>{`
        @keyframes fade-in {
          from { opacity: 0; transform: translateY(8px); }
          to { opacity: 1; transform: translateY(0); }
        }
        .animate-fade-in {
          animation: fade-in 0.4s ease-out forwards;
        }
      `}</style>
    </div>
  );
};

export default BiorhythmPreview;
